import React, {Component} from 'react';
import { Route, Switch, useRouteMatch } from 'react-router';
import { Link } from 'react-router-dom';
import './MenuPage.css';

function MenuPage() {
    return (
        <div className="navigation-menu-page">
            <div class="menu-title-label"></div>      
            <div class="menu-title-divider divider-03"></div>      
            <ul className="app-navigation-container">
              <li className="app-navigation-button border-04" onClick={loadPage}><Link to="/builds">Builds</Link></li>
              <li className="app-navigation-button border-04"><Link to="/heroes">Heroes</Link></li>
              <li className="app-navigation-button border-04"><Link to="/login">Login</Link></li>
              <li className="app-navigation-button border-04"><Link to="/register">Register</Link></li>
              <li className="app-navigation-button border-04"><Link to="/about">About</Link></li>
            </ul>
        </div>
    );
  }

function loadPage() {
    var root = document.getElementById('root');
    console.log(root);
    root.classList.remove('showNav');
}

export default MenuPage;
